import React from "react";
import Navbar from "react-bootstrap/Navbar";
import Nav from "react-bootstrap/Nav";
import NavDropdown from "react-bootstrap/NavDropdown";

import "bootstrap/dist/css/bootstrap.min.css";

const Header = () => {
  return (
    <Navbar collapseOnSelect expand="lg" bg="dark" variant="dark">
      <Navbar.Brand>tester</Navbar.Brand>
      <Navbar.Toggle aria-controls="responsive-navbar-nav" />
      <Navbar.Collapse id="responsive-navbar-nav">
        <Nav className="mr-auto">
          <Nav.Link href="#features">Home</Nav.Link>
          <Nav.Link href="#pricing">Add question</Nav.Link>
          <NavDropdown title="Choose difficulity" id="collasible-nav-dropdown">
            <NavDropdown.Item href="#action/3.1">Easy</NavDropdown.Item>
            <NavDropdown.Item href="#action/3.2">Normal</NavDropdown.Item>
            <NavDropdown.Item href="#action/3.3">Hard</NavDropdown.Item>
          </NavDropdown>
          <Nav.Link href="#history">History</Nav.Link>
        </Nav>
      </Navbar.Collapse>
    </Navbar>
  );
};

export default Header;
